import React from 'react';
import doctor from  '../../Images/Wellcome/doctor.PNG'
import './Welcome.css'

const Welcome = () => {
    return (
        <div className='welcome'>
            <div>
                <img src={doctor} alt="" />
            </div>
            <div >
                <div >
                <h1 >Request Appointment</h1>
                <h1>Find Doctor</h1>
                <h1>Find Location</h1>
                <h1>Emergency Contact</h1>
                </div>
                
            </div>
        </div>
    );
};

export default Welcome;
